import React, {useState} from 'react';
import Token from './token';

function DropZone() {
  const [isDropping, setIsDropping] = useState(false); 
  const color = 'red';

  return (
    <div className={`drop ${isDropping ? 'disable' : ''}`}>
      <Token key={1} setDropping={(value) => setIsDropping(value)} color={color}/>
      <Token key={2} setDropping={(value) => setIsDropping(value)} color={color}/>
      <Token key={3} setDropping={(value) => setIsDropping(value)} color={color}/>
      <Token key={4} setDropping={(value) => setIsDropping(value)} color={color}/>
      <Token key={5} setDropping={(value) => setIsDropping(value)} color={color}/>
      <Token key={6} setDropping={(value) => setIsDropping(value)} color={color}/>
      <Token key={7} setDropping={(value) => setIsDropping(value)} color={color}/>
    </div>
  );
}

export default DropZone;
